package com.thrive.common.testdata.pojos.user_details;

public class GlobalCoachProfileDetails {
	
	private String password;
	private String mobileNumber;
	private String gender;
	private String ethnicity;
	private String country;
	private String nationality;
	private String address1;
	private String address2;
	private String city;
	private String state;
	private String county;
	private String region;
	private String postcode;
	

	
	public GlobalCoachProfileDetails(String password, String mobileNumber, String gender, String ethnicity,
			String country, String nationality, String address1, String address2, String city, String state,
			String county, String region, String postcode) {
		super();
		this.password = password;
		this.mobileNumber = mobileNumber;
		this.gender = gender;
		this.ethnicity = ethnicity;
		this.country = country;
		this.nationality = nationality;
		this.address1 = address1;
		this.address2 = address2;
		this.city = city;
		this.state = state;
		this.county = county;
		this.region = region;
		this.postcode = postcode;
	}
	public String getPassword() {
		return password;
	}
	public void setPassword(String password) {
		this.password = password;
	}
	public String getMobileNumber() {
		return mobileNumber;
	}
	public void setMobileNumber(String mobileNumber) {
		this.mobileNumber = mobileNumber;
	}
	public String getGender() {
		return gender;
	}
	public void setGender(String gender) {
		this.gender = gender;
	}
	public String getEthnicity() {
		return ethnicity;
	}
	public void setEthnicity(String ethnicity) {
		this.ethnicity = ethnicity;
	}
	public String getCountry() {
		return country;
	}
	public void setCountry(String country) {
		this.country = country;
	}
	public String getNationality() {
		return nationality;
	}
	public void setNationality(String nationality) {
		this.nationality = nationality;
	}
	public String getAddress1() {
		return address1;
	}
	public void setAddress1(String address1) {
		this.address1 = address1;
	}
	public String getAddress2() {
		return address2;
	}
	public void setAddress2(String address2) {
		this.address2 = address2;
	}
	public String getCity() {
		return city;
	}
	public void setCity(String city) {
		this.city = city;
	}
	public String getState() {
		return state;
	}
	public void setState(String state) {
		this.state = state;
	}
	public String getCounty() {
		return county;
	}
	public void setCounty(String county) {
		this.county = county;
	}
	public String getRegion() {
		return region;
	}
	public void setRegion(String region) {
		this.region = region;
	}
	
	public String getPostcode() {
		return postcode;
	}
	public void setPostcode(String postcode) {
		this.postcode = postcode;
	}
	
	
	
	

}
